// client/src/pages/CartPage.tsx
import React from 'react';
import { useCart } from '../context/CartContext';
import { Link } from 'react-router-dom';

const CartPage: React.FC = () => {
  const { cartItems, addToCart, removeFromCart, clearCart } = useCart();

  const calculateTotalPrice = () => {
    return cartItems.reduce((acc, item) => acc + item.price * item.quantity, 0).toFixed(2);
  };

  return (
    <div className="container mx-auto p-4 my-8">
      <h1 className="text-4xl font-bold text-center mb-8 text-gray-900">Shopping Cart</h1>

      {cartItems.length === 0 ? (
        <div className="text-center p-8 bg-white rounded-lg shadow-md">
          <p className="text-xl text-gray-600 mb-4">Your cart is empty.</p>
          <Link to="/" className="text-blue-600 hover:underline text-lg">Go back to shopping</Link>
        </div>
      ) : (
        <div className="flex flex-col md:flex-row gap-8">
          {/* Cart Items List */}
          <div className="md:w-3/4 bg-white p-6 rounded-lg shadow-xl">
            {cartItems.map((item) => (
              <div key={item.id} className="flex items-center border-b border-gray-200 py-4 last:border-b-0">
                <Link to={`/product/${item.id}`} className="flex-shrink-0">
                  <img src={item.imageUrl} alt={item.name} className="w-20 h-20 object-cover rounded-md mr-4" />
                </Link>
                <div className="flex-grow">
                  <Link to={`/product/${item.id}`}>
                    <h2 className="text-xl font-semibold text-gray-800 hover:text-blue-600">{item.name}</h2>
                  </Link>
                  <p className="text-gray-600">${item.price.toFixed(2)}</p>
                </div>
                <div className="flex items-center ml-4">
                  <button
                    onClick={() => addToCart(item, -1)} // Decrease quantity by 1
                    disabled={item.quantity <= 1}
                    className="p-2 border border-gray-300 rounded-md hover:bg-gray-100 disabled:opacity-50 disabled:cursor-not-allowed"
                  >
                    -
                  </button>
                  <span className="mx-3 text-lg font-medium">{item.quantity}</span>
                  <button
                    onClick={() => addToCart(item, 1)} // Increase quantity by 1
                    disabled={item.quantity >= item.countInStock} // Prevent adding more than stock
                    className="p-2 border border-gray-300 rounded-md hover:bg-gray-100 disabled:opacity-50 disabled:cursor-not-allowed"
                  >
                    +
                  </button>
                  <button
                    onClick={() => removeFromCart(item.id)}
                    className="ml-4 text-red-600 hover:text-red-800 transition-colors duration-200"
                  >
                    Remove
                  </button>
                </div>
              </div>
            ))}
            <div className="mt-6 flex justify-end">
              <button
                onClick={clearCart}
                className="bg-red-500 text-white px-6 py-2 rounded-md hover:bg-red-600 transition-colors duration-300"
              >
                Clear Cart
              </button>
            </div>
          </div>

          {/* Cart Summary */}
          <div className="md:w-1/4 bg-white p-6 rounded-lg shadow-xl">
            <h2 className="text-2xl font-bold text-gray-900 mb-4">Cart Summary</h2>
            <div className="flex justify-between items-center mb-4">
              <p className="text-lg text-gray-700">Items ({cartItems.reduce((acc, item) => acc + item.quantity, 0)}):</p>
              <p className="text-xl font-semibold text-gray-800">${calculateTotalPrice()}</p>
            </div>
            <button className="w-full bg-green-600 text-white px-6 py-3 rounded-md text-lg font-semibold hover:bg-green-700 transition-colors duration-300">
              Proceed to Checkout
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default CartPage;
